import React from "react";
import "../Navigation/Navigation.scss";
import {Button} from 'react-bootstrap';



const ConfirmLogin =(user) =>{
  return user.isLogin ;

}
const isLogin ={
  isLogin: false
 
}
const element =(
  <button>{isLogin ? 'Login' : 'SignUp'}</button>
)



export default NavLoggedin;
